The IM plates usually have two ambital fringe spines (
Fig. 1E
). These spines are moderately compressed to slightly rounded and are usually erect at the interradial arc and appressed distally. The fringe spines are about equal in length, or the distal spine is slightly longer. Below and adjacent to the ambital fringe spines are 1 or 2 shorter, acute spines, similar in length to the spines along the distal edge of the IM plate’s actinal surface. The actinal surface of the IM plates is typically bare, with the exception of one or two tubercles, and lacks squamules (short, flat, scalelike spines).

Adambulacral plates possess two discrete rows of compressed and acute or blunt spines (
Fig. 1F
). The first adambulacral row (furrow spines) has a long middle spine perpendicular to the ambulacral groove and shorter, proximal and distal spines. The second row (first subambulacral row) of spines is composed of 3 flat, acute spines, the middle one of which is wider and longer than the proximal and distal spines. This middle spine is usually longer than the middle spine of the first row, while the proximal and distal spines of the second adambulacral row are about the same length as the proximal and distal spines of the first row. Variation: a third row of adambulacral spines may be present on some (usually very few) plates. This row may have 1 or 2 acicular (rod-shaped; round in cross section) spinelets that are much shorter than all the other spines on the same plate.
